import React from "react";
import styled from "styled-components";

export default function Navbar() {
  const navbardata = ["Maintainance"];
  return (
    <MainContainer>
      <NavbarMainContainer>
        <LogoImg>
          <img src="/public/navbarimgcontainer/householdwebsitelogo.jpg" alt="HouseHoldWebsite" />
        </LogoImg>
        <NavbarContent>
          <ul>
            <li></li>
          </ul>
        </NavbarContent>
      </NavbarMainContainer>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  border: 2px solid yellowgreen;
`;
const NavbarMainContainer = styled.nav`
  border: 2px solid crimson;
`;
